import './main.scss'
import Popup from '../components/popup.component/popup.component'
import { useState, useEffect } from 'react'


const Main = () => {
  const [timerPopup, setTimerPopup] = useState(false);

  useEffect(() => {
    setTimeout(()=>{
      setTimerPopup(true)
    }, 3000)
  }, [])


  return (
    <div className="main">
      <div className="main-inner">
      <Popup trigger={timerPopup} setTrigger={setTimerPopup}/>
      </div>
    </div>

  )
}

export default Main
